import React from 'react';
import './Services.css';

function Services() {
  return (
    <div className="services">
      <h1>Our Services</h1>
      <div className="service-item">
        <h2>Web Development</h2>
        <p>Custom websites built for your brand.</p>
      </div>
      <div className="service-item">
        <h2>App Development</h2>
        <p>Intuitive apps for Android and iOS.</p>
      </div>
    </div>
  );
}

export default Services;
